{
  pre_parse_html => sub {
    my($html) = @_;
    die('missing year')
      unless $$html =~ /.*?(\w+) (20\d{2})</;
    my($month, $year) = ($1, $2);
    $month = b_use('Scraper.RegExp')->month_as_int($month);
    $month++;
    if ($month > 12) {
      $month = 1;
      $year++;
    }
    my($next_url) = "http://www.oskarblues.com/?eme_ajaxCalendar=true&calmonth=$month&calyear=$year&full=1&long_events=0&category=0&author=&contact_person=&location_id=";
    die('next link')
      unless $$html =~ s/(href=")#(">&gt;&gt;<)/$1$next_url$2/;
    return;
  },
  pager => {
    link => qr/\n(>>\{\d+\})/i,
    page_count => 3,
  },
  location_to_venue => {
