      fields => [qw(month year)],
    }],
  ],
  repeat => [
    [qr/\n(.*?})\n\((.*?)\)/ => {
      fields => [qw(summary location)],
      follow_link => {
        once => [
          [qr/From\: $time_ap to $time_ap on $month, $day $year\n+$line+\n+$line/i => {
            fields => [qw(start_time end_time month day year ignore description)],
          }],
        ],
      },
    }],
  ],
}

